try{!function(t){"use strict";window.calcSprite=function(t,i,o,r){var n={size:0,position:0};if(i=parseFloat(i,10),o=parseFloat(o,10),i>0&&o>0){var a=i/o;(t=parseFloat(t,10))>0&&(n.size=t/a),(r=parseFloat(r,10))&&-1===r.toString().indexOf("Infinity")&&(n.position=r/a)}return n}}()}catch(t){console.error(t)}